import React from "react";
import styled from "styled-components"; 
// import {Grid, Image, Text, Input} from "../elements";


const Post = (props) => {

    return (
        <React.Fragment>
            <PostContainer>
            <div>{props.image_url}</div>
            <div>{props.user_info.profile}</div>
            <div>{props.user_info.nickname}</div>
            <div>{props.contents}</div>
            <div>{props.comments}</div>
            <div>{props.like_cnt}</div>
            <div>{props.comment_cnt}</div>
            <input>댓글 달기</input>
            </PostContainer>


        </React.Fragment>    
        )
}

Post.defalutProps ={
    id: 0,
    user_info: {
        nickname: "_nickname",
        profile: "https://www.zdnet.com/a/hub/i/r/2018/10/18/580b4d43-4060-4d90-be23-1f97ef795e4e/resize/1200x900/757c6793f448336b1a2c73a5d46fb971/github-logo.png",
    },
    image_url: "https://www.zdnet.com/a/hub/i/r/2018/10/18/580b4d43-4060-4d90-be23-1f97ef795e4e/resize/1200x900/757c6793f448336b1a2c73a5d46fb971/github-logo.png",
    contents: "개발자들의 커뮤니티",
    comment_cnt: 8,
    like_cnt: 20,
    insert_dt: "2021-04-12 10:00:00",
};

const PostContainer = styled.div`
    width: 100%;
`;

export default Post;
